import React from "react";
import { NavLink } from "react-router-dom";


const Navbar = () => {

return(
    <>
    {/* // <div className="container-fluid nav_bg fixed-top" >
    //     <div className="row" >
    //         <div className="col-12 mx-auto" > */}
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">Navbar</a>
    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav mr-auto mb-2 mb-lg-0">
        <li class="nav-item">
 
          <NavLink activeClassName="menu_active" className="nav-link active" aria-current="page" to="/">Home</ NavLink>
        </li>
        <li className="nav-item text-center">
          <NavLink activeClassName="menu_active" className="nav-link" to="/about">About</NavLink>
        </li>
        <li className="nav-item text-center">
          <NavLink activeClassName="menu_active" className="nav-link" to="/faculty">Service</NavLink>
        </li>
        <li className="nav-item text-center">
          <NavLink activeClassName="menu_active" className="nav-link" to="/contact">Contact</NavLink>
        </li>
        <li className="nav-item text-center ">
          <a className="nav-link"  href="https://bitscse.herokuapp.com/studynotes">Study Notes</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
{/* </div>
        </div>

    </div> */}
    </>
);
};
export default Navbar;
